import { useState } from "react";
import './App.css';
import Select from "./components/select";
const App = () => {
  const [SelectData] = useState([[{
    "deptno": "347",
    "deptname": "資工系"
  },{
    "deptno": "348",
    "deptname": "電機系"
  }]]);
  return (
    <div className="App">
      <Select SelectData={SelectData}/>
    </div>
  );
}

export default App;
